import React, { useState, useEffect } from 'react';
import Navbar from '../../components/Common/Navbar';
import LogoutButton from '../../components/Common/LogoutButton';
import UserInfo from '../../components/Common/UserInfo';
import axios from 'axios';
import './RobotEditPage.css'; // CSS 분리

function RobotEditPage() {
  const [robots, setRobots] = useState([]);
  const [selectedRobot, setSelectedRobot] = useState(null);
  const [name, setName] = useState('');
  const [ip, setIp] = useState('');
  const [model, setModel] = useState('');

  useEffect(() => {
    fetchRobots();
  }, []);

  const fetchRobots = async () => {
    const token = localStorage.getItem('token');

    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    try {
      const response = await axios.get('http://172.30.1.15:5559/robot/robots', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });
      setRobots(response.data);

      // 기본 선택: 첫 번째 로봇
      if (response.data.length > 0) {
        handleSelectRobot(response.data[0]);
      }
    } catch (error) {
      console.error('Error fetching robots:', error);
    }
  };

  const handleSelectRobot = (robot) => {
    setSelectedRobot(robot);
    setName(robot.name);
    setIp(robot.ip);
    setModel(robot.model);
  };

  const handleUpdate = async (e) => {
    e.preventDefault();

    const token = localStorage.getItem('token');
    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    try {
      await axios.put(`http://172.30.1.15:5559/robot/update/${selectedRobot._id}`, {
        name,
        ip,
        model
      }, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });
      alert('Robot updated successfully');
      fetchRobots();
    } catch (error) {
      console.error('Error updating robot:', error);
      alert(`Error updating robot: ${error.response?.data?.message || error.message}`);
    }
  };

  const handleRemove = async () => {
    const token = localStorage.getItem('token');

    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    if (window.confirm('Are you sure you want to remove this robot?')) {
      try {
        await axios.put(`http://172.30.1.15:5559/robot/unregister/${selectedRobot._id}`, {}, {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });
        alert('Robot removed successfully');
        setSelectedRobot(null); // 선택된 로봇 초기화
        fetchRobots(); // 목록 새로고침      
      } catch (error) {
        console.error('Error removing robot:', error);
        alert(`Error removing robot: ${error.response?.data?.message || error.message}`);
      }
    }
  };

  return (
    <div className="robot-edit-page">
      <header className="header">
        <UserInfo />
        <LogoutButton />
      </header>
      <div className="main-content">
        <Navbar />
        <div className="content">
          <div className="robot-list">
            <h3>Your Robots</h3>
            <ul>
              {robots.map((robot) => (
                <li
                  key={robot._id}
                  onClick={() => handleSelectRobot(robot)}
                  className={selectedRobot && selectedRobot._id === robot._id ? 'selected' : ''}
                >
                  {robot.name} - {robot.ip}
                </li>
              ))}
            </ul>
          </div>
          {selectedRobot && (
            <div className="robot-details">
              <h3>Edit Robot</h3>
              <form onSubmit={handleUpdate}>
                <input
                  type="text"
                  placeholder="Robot Name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                  required
                />
                <input
                  type="text"
                  placeholder="Robot IP"
                  value={ip}
                  onChange={(e) => setIp(e.target.value)}
                  required
                />
                <input
                  type="text"
                  placeholder="Robot Model"
                  value={model}
                  onChange={(e) => setModel(e.target.value)}
                  required
                />
                <div className="button-group">
                  <button type="submit" className="update-button">Update Robot</button>
                  <button type="button" onClick={handleRemove} className="remove-button">Remove Robot</button>
                </div>
              </form>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default RobotEditPage;
